import React from 'react';
import '../../../resource/css/joinView.css';
import {getFormParam} from '../../../common/module/form';
import JoinViewModel from '../ViewModel/joinViewModel';

const JoinInput = (props) => {
    return <input className="joinPage_input" type={props.type} placeholder={props.placeholder} name={props.name}/>
}

function JoinView() {

    const onSubmit = (e : any) : void => {
        e.preventDefault();
        const loginData:{} = getFormParam(e);

        JoinViewModel.validation(loginData);

        JoinViewModel.joinRequest(loginData);
    }

    return (
    <div className="joinPage">
        <h1 className="joinPage_h1">계정 정보를 입력해주세요</h1>
            <form>
                <h2 className="joinPage_h2">계정 이메일</h2>
                <JoinInput type={'text'} placeholder={'이메일 주소 입력'} name={'id'}/>
                <span className="joinPage_loingState">test</span>
                <h2 className="joinPage_h2">비밀번호</h2>
                <JoinInput type={'password'} placeholder={'비밀번호(8~32자리)'} name={'password'}/>
                <JoinInput type={'password'} placeholder={'비밀번호 재입력'} name={'passwordRe'}/>

                <h2 className="joinPage_h2">닉네임</h2>
                <JoinInput type={'text'} placeholder={'닉네임을 입력해주세요.'} name={'nickName'}/>

                <input className="joinPage_submit" type="submit" value="다음" onSubmit={onSubmit}/>
            </form>
    </div>
    )
}

export default JoinView;
